sap.ui.define(["sap/ui/core/format/DateFormat"],function(t){"use strict";return{formatCurrentDateTime:function(){return(new Date).toLocaleString()},formatDate:function(t){const e=t=>t.toString().padStart(2,"0");if(!t){return""}const n=e(t.getDate());const r=e(t.getMonth()+1);const o=t.getFullYear().toString().slice(-2);const u=e(t.getHours());const i=e(t.getMinutes());const c=e(t.getSeconds());return`${n}-${r}-${o} ${u}:${i}:${c}`},Delete:function(t){if(t==="X"){return"Deleted"}else if(t===null||t===undefined||t===""){return""}return t}}});